import { Station_new } from "../types";
import bvIndication from "./media/Pacemaker/bvIndication.mp3";
import bvIndicationQuestion from "./media/Pacemaker/bvIndicationQuestion.mp3"
import nameDevice from "./media/Pacemaker/nameDevice.mp3";
import nameDeviceQuestion from "./media/Pacemaker/nameDeviceQuestion.mp3"
import singleVdual from "./media/Pacemaker/singleVdual.mp3";
import singleVdualQuestion from "./media/Pacemaker/singleVdualQuestion.mp3"
import pacemaker from './media/Pacemaker/pacemaker.png'
import ngManagement from "./media/slide_3/ngManagement.mp3";
import ngPosition from "./media/slide_3/ngPosition.mp3";
import tellCorrectPlace from "./media/slide_3/tellCorrectPlace.mp3";
import NGtube from './media/slide_3/NGtube.jpeg'
import abnormality from "./media/slide_4/abnormality.mp3";
import histoCancer from "./media/slide_4/histoCancer.mp3";
import lungcancer from './media/slide_4/lungcancer.webp'

export const MedicalDeviceStation: Station_new = {

    title: "Medical Devices / Imaging",

    timePermitted: 1000,
    timeRemaining: 1000,

    brief: {
        timePermitted: 60,
        timeRemaining: 60,
        prompt: (
            <div>
                <p>Your task is to:</p>

                <p>
                    <div>1. Interpret the data presented to you</div>
                    <div>2. Formulate a working diagnosis</div>
                    <div>3. Answer the associated questions</div>
                </p>
            </div>
        )
    },

    questions: [
        {
            question: "Name the medical device in this CXR",
            questionUrl: nameDeviceQuestion,
            imgsrc: pacemaker,
            responseUrl: "",
            exemplarUrl: nameDevice,
            markScheme: [
                {
                    title: "Name of medical device",
                    points: [
                        { point: "Biventricular pacemaker", selected: false, pointId: 0 },
                    ]
                }
            ] 
        },
        {
            question: "What is the difference between a single vs dual ventricular pacemaker?",
            questionUrl: singleVdualQuestion,
            imgsrc: pacemaker,
            responseUrl: "",
            exemplarUrl: singleVdual,
            markScheme: [
                {
                    title: "Single versus dual chamber pacemaker",
                    points: [
                        { point: "Single chamber has one wire", selected: false, pointId: 0 },
                        { point: "Dual chamber has two wires", selected: false, pointId: 1 },
                        { point: "Biventricular has three wires", selected: false, pointId: 2 },
                    ]
                }
            ]
        },
        {
            question: "Give one clinical indication for a biventricular pacemaker.",
            questionUrl: bvIndicationQuestion,
            imgsrc: pacemaker,
            responseUrl: "",
            exemplarUrl: bvIndication,
            markScheme: [
                {
                    title: "Indications for biventricular pacemaker",
                    points: [
                        { point: "Congestive cardiac failure", selected: false, pointId: 0 },
                    ]
                }
            ] 
        },
    ],
}
